class Solution {
  int _gcd(int a, int b) => b == 0 ? a : _gcd(b, a % b);

  bool canTraverseAllPairs(List<int> nums) {
    final n = nums.length;
    List<int> parent = List.generate(n, (i) => i);
    List<int> size = List.generate(n, (i) => 1);

    int find(int x) {
      if (x != parent[x]) parent[x] = find(parent[x]);
      return parent[x];
    }

    void union(int x, int y) {
      int rootX = find(x);
      int rootY = find(y);
      if (rootX != rootY) {
        if (size[rootX] < size[rootY]) {
          parent[rootX] = rootY;
          size[rootY] += size[rootX];
        } else {
          parent[rootY] = rootX;
          size[rootX] += size[rootY];
        }
      }
    }

    for (int i = 0; i < n - 1; i++) {
      for (int j = i + 1; j < n; j++) {
        if (_gcd(nums[i], nums[j]) > 1) {
          union(i, j);
        }
      }
    }

    int root = find(0);
    for (int i = 1; i < n; i++) {
      if (find(i) != root) return false;
    }
    return true;
  }
}
